pub enum Error {

    /// Io error occured.
    Io(::std::io::Error),

    /// Unsupported version.
    Version(u32),

    /// Magic says that file is not glTF.
    Magic([u8; ]),

    /// Length specified in GLB header exceeeds that of slice.
    Length {
        /// length specified in GLB header.
        length: u32,
        /// Actual length of data read.
        length_read: usize,
    },

    /// Stream ended before we could read the chunk.
    ChunkLength {
        /// chunkType error happened at.
        ty: ChunkType,
        /// chunkLength.
        length: u32,
        /// Actual length of data read.
        length_read: usize,
    },

    /// Chunk of this chunkType was not expected.
    ChunkType(ChunkType),

    /// Unknown chunk type.
    UnknownChunkType([u8; ]),
}

pub enum ChunkType {

